AWS_ACCESS_KEY = os.environ.get('FD_AWS_ACCESS_KEY')
AWS_SECRET_KEY = os.environ.get('FD_AWS_SECRET_KEY')

FD_API_KEY = os.environ.get('FD_FD_API_KEY')
FD_DOMAIN = os.environ.get('FD_FD_DOMAIN')
FD_PASSWORD = os.environ.get('FD_FD_PASSWORD')

def upload_file_to_s3(file_name, bucket, object_name=None):
    """Upload a file to an S3 bucket

    :param file_name: File to upload
    :param bucket: Bucket to upload to
    :param object_name: S3 object name. If not specified then file_name is used
    :return: True if file was uploaded, else False
    """

    # If S3 object_name was not specified, use file_name
    if object_name is None:
        object_name = file_name

    # Upload the file
    s3_client = boto3.client(
	    's3',
    	aws_access_key_id=AWS_ACCESS_KEY,
    	aws_secret_access_key=AWS_SECRET_KEY
	)
    try:
        response = s3_client.upload_file(file_name, bucket, object_name)
    except ClientError as e:
        logging.error(e)
        return False
    return True


def read_file_from_s3(file_name, bucket):
    """Read a file from an S3 bucket

    :param file_name: File to read
    :param bucket: Bucket to read from
    :return: the file content
    """
    s3 = boto3.resource('s3',
                    aws_access_key_id=AWS_ACCESS_KEY,
                    aws_secret_access_key=AWS_SECRET_KEY
                    )
    content_object = s3.Object(bucket, file_name)
    file_content = content_object.get()['Body'].read().decode('utf-8')
    json_content = json.loads(file_content)
    return json_content


def image_to_b64(path):
    with open(path, 'rb') as img_file:
        return base64.b64encode(img_file.read())


def save_image(b64_image, path='ss.png'):
    with open(path, 'wb') as fh:
        fh.write(base64.decodebytes(b64_image))
    return path


def create_fd_ticket(evidence):
    file_name = save_image(evidence['screenshot_encoded'][22:].encode())
    description = {
    "url": evidence['url'],
    "local_storage": evidence['local_storage'],
    "system_info": evidence['system_info'],
    "log_data": evidence['log_data']
    }

    multipart_data = [
        ('email', (None,'bp@fyle.in')),
        ('subject', (None, evidence['title'])),
        ('status', (None, '2')),
        ('priority', (None, '2')),
        ('attachments[]', (file_name, open(file_name, 'rb'), 'image/png')),
        ('description', (None, json.dumps(description)))
    ]

    r = requests.post('https://'+ FD_DOMAIN +'.freshdesk.com/api/v2/tickets', auth = (FD_API_KEY, FD_PASSWORD), files = multipart_data)

    if r.status_code == 201:
        print("Ticket created successfully, the response is given below" + r.text)
        print("Location Header : " + r.headers['Location'])
    else:
        print("Failed to create ticket, errors are displayed below,")
        response = json.loads(r.content)
        print(response["errors"])

        print("x-request-id : " + r.headers['x-request-id'])
        print("Status Code : " + str(r.status_code))


